import React, { Component } from 'react'
import { Table, Divider, Tag } from 'antd'
import { array } from 'prop-types';

class FormWaiting extends Component {
    constructor() {
        super()
        this.state = {
            column: [{
                title: "ลำดับที่",
                dataIndex: "rown"
            },
            {
                title: "ชื่อ",
                dataIndex: "custommer_name"
            },
            {
                title: "เบอร์ติดต่อ",
                dataIndex: "custommer_phone"
            },
            {
                title: "E-Mail",
                dataIndex: "custommer_email"
            },
            {
                title: "linkรถ",
                dataIndex: "car_product_id"
            },
            {
                title: "สถานะปัจจุบัน",
                dataIndex: "car_status_name"
            },
            {
                title: "สถานะปัจจุบัน",
                dataIndex: "car_status_name"
            }],
            dataTable: []
        }
    }
    componentDidMount() {
        fetch("http://183.88.219.85:9091/api/waiting_car.php")
            .then(res => res.json())
            .then(res => {
                this.setState({
                    dataTable: res
                })
            })
    }
    render() {
        return (<div>
            formwaiting
            <Table columns={this.state.column} dataSource={this.state.dataTable} />
        </div>)
    }
}

export default FormWaiting
